import { features } from "../data/countries.json";

// exports.getTopEvents = function (req, res) {
exports.findCountryCode = function (country) {
  for (const f of features) {
    if (f.properties.ADMIN === country) {
      return f.properties.ISO_A3;
    }
  }
};
